            {[event.target.name]: event.target.value}
        )
    }

    render() {
        return (
            <Container className="mt-3">
                <h2>{this.props.match.params.id}</h2>
                <h2>Add New UNIT</h2>
                <Button onClick={this.cancelClicked.bind(this)}>Cancel</Button>
